import React from "react";
import { useDispatch } from "react-redux";
import { onStart } from "../reducers/astronauts";
import { Information } from "./Information";

export const Astronauts = () => {
  const dispatch = useDispatch();

  return (
    <div>
      <Information
        onStart={() => {
          dispatch(onStart());
        }}
      />
    </div>
  );
};
